import React from "react";
import { Link } from "react-router-dom";
import axios from 'axios';
import { render } from "@testing-library/react";
import Navbar from "../components/Navbar1";
import { BrowserRouter as Router, Switch, Route } from "react-router-dom";
import './guideline.css';
import logo from '../icons/Home.png';

class GuidelineStl extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      error: null,
      isLoaded: false,
      guideline: []
    };
  }

  componentDidMount() {
    fetch("http://localhost:3000/guideline/stl")
      .then(res => res.json())
      .then(
        (result) => {
          this.setState({
            isLoaded: true,
            guideline: res
          });
        },
        (error) => {
          this.setState({
            isLoaded: true,
            error
          });
        }
      )
  }


  render() {

    const { error, isLoaded, guideline } = this.state;
    if (error) {
      return <div>Error: {error.message}</div>;
    } else if (!isLoaded) {
      return <div>Loading...</div>;
    } else {

      return (
        <>
          <div>
            <img className="logo" src={logo} alt="Logo" />
          </div>

          <div className="sidebar">
            <Navbar />
          </div>

          <div className="container">
            <div className="address">
              <div style={{ fontSize: '9px', color: '#7f7f7f' }}>Home > Guidelines > Sign the lease</div>
            </div>
            <div style={{ fontSize: '9px', color: '#7f7f7f' }}>{numOfResult} guidelines</div>
            <div>

              {/* <ul className="items">
